import React, { Component } from 'react'

const LogProps = ChildComp => {
  
  class NewComp extends Component {
    
    componentDidMount(){
      console.log(this.props);
    }
    render() {
      return <ChildComp {...this.props}/>;
    }
  }
  return NewComp ;

}

export default LogProps
